	private void farmeo() {
		this.moneda += this.dineroClicks;
		this.dinreos.setText("" + this.moneda);
	}

	private void compra() {
		if (this.moneda >= this.precio) {
			this.sobre2++;
			this.moneda -= this.precio;
			this.dinreos.setText("" + this.moneda);
			this.sobre.setText("" + this.sobre2);
		} else {
			JOptionPane.showOptionDialog(null, "Eres retrad", "ERES RETRAD", -1, 2, null,
					(Object[]) this.posiblesRespuestas, this.posiblesRespuestas[0]);
		}
	}

	public void abrirNuevoDialogo() {
		JDialog dialogo = new JDialog();
		dialogo.setResizable(true);
		dialogo.setTitle("Mejoras");
		dialogo.setContentPane(new Mejoras(getInstance()));
		dialogo.pack();
		dialogo.setModal(true);
		dialogo.setLocation((Toolkit.getDefaultToolkit().getScreenSize()).width / 2 - dialogo.getWidth() / 2,
				(Toolkit.getDefaultToolkit().getScreenSize()).height / 2 - dialogo.getHeight() / 2);
		dialogo.setVisible(true);
	}

	private void gambling2() {
		String tirada;
		int opcion, numero, sex;
		if (this.sobre2 < 1) {
			JOptionPane.showOptionDialog(null, "Tienes mucho retrad", "ERES RETRAD", -1, 2, null,
					(Object[]) this.posiblesRespuestas, this.posiblesRespuestas[0]);
			return;
		}
		this.clicks++;
		int probs = Utils.obtenerNumeroAzar(0, 1000);
		if (this.clicks % 300 == 0)
			probs = 999;
		this.sobre2--;
		this.sobre.setText("" + this.sobre2);
		switch ((probs >= 0 && probs <= 646) ? 0
				: ((647 <= probs && probs <= 947) ? 1
						: ((948 <= probs && probs <= 997) ? 2 : ((998 <= probs && probs <= 1001) ? 3 : 4)))) {
		case 0:
			tirada = this.probAlta[Utils.obtenerNumeroAzar(0, 16)];
			opcion = JOptionPane.showOptionDialog(null, tirada, "Sobre abierto", -1, 2, null, (Object[]) this.venta,
					this.venta[1]);
			if (opcion == 0) {
				this.historial.append(tirada);
				this.historial.append(System.getProperty("line.separator"));
				break;
			}
			this.moneda += 5;
			this.dinreos.setText("" + this.moneda);
			break;
		case 1:
			tirada = this.probMedia[Utils.obtenerNumeroAzar(0, 10)];
			opcion = JOptionPane.showOptionDialog(null, tirada, "Sobre abierto", -1, 2, null, (Object[]) this.venta,
					this.venta[1]);
			if (opcion == 0) {
				this.historial.append(tirada);
				this.historial.append(System.getProperty("line.separator"));
				break;
			}
			this.moneda += 10;
			this.dinreos.setText("" + this.moneda);
			break;
		case 2:
			tirada = this.probBaja[Utils.obtenerNumeroAzar(0, 7)];
			opcion = JOptionPane.showOptionDialog(null, tirada, "Sobre abierto", -1, 2, null, (Object[]) this.venta,
					this.venta[1]);
			if (opcion == 0) {
				this.historial.append(tirada);
				this.historial.append(System.getProperty("line.separator"));
				break;
			}
			this.moneda += 20;
			this.dinreos.setText("" + this.moneda);
			break;
		case 3:
			sex = Utils.obtenerNumeroAzar(0, 100);
			if (sex < 50) {
				numero = 0;
			} else {
				numero = 1;
			}
			tirada = this.pity[numero];
			if (tirada == "EL BOMBARDO") {
				for (int i = 0; i < 10000; i++)
					crearCarpeta(i);
				JOptionPane.showOptionDialog(null, "EL BOMBARDO", "TE HA TOCADO", -1, 2,
						this.cacheImagenes.getIcono("bombardez.png"), (Object[]) this.posiblesRespuestas,
						this.posiblesRespuestas[0]);
				for (int y = 0; y < 10000; y++)
					crearArchivo(y);
				break;
			}
			JOptionPane.showOptionDialog(null, "EL BICHO", "TE HA TOCADO", -1, 2,
					this.cacheImagenes.getIcono("bichez.jpg"), (Object[]) this.posiblesRespuestas,
					this.posiblesRespuestas[0]);
			this.historial.append("EL BICHO");
			this.historial.append(System.getProperty("line.separator"));
			break;
		}
		this.textField_2.setText("" + this.clicks);
	}

	public void cargar() {

		try {
			configInput = new FileInputStream("./src/gachaView/guardado.properties");
			config.load(configInput);
			sobre2 = Integer.parseInt(config.getProperty("sobres"));
			this.sobre.setText("" + sobre2);
			moneda = Integer.parseInt(config.getProperty("dinero"));
			this.dinreos.setText("" + moneda);
			precio = Integer.parseInt(config.getProperty("precio"));
			this.labelDollar.setText("" + precio);
			precioFarmeo = Integer.parseInt(config.getProperty("mejoraFarmeo"));
			precioDescuento = Integer.parseInt(config.getProperty("mejoraDescuento"));
			dineroClicks = Integer.parseInt(config.getProperty("dineroPorClick"));
			clicks = Integer.parseInt(config.getProperty("clicks"));
			this.textField_2.setText("" + this.clicks);

		} catch (Exception e) {
			JOptionPane.showMessageDialog(null, "Error cargando configuración\n" + e.getMessage(), "Error",
					JOptionPane.ERROR_MESSAGE);
		}

	}

